import React from 'react';
import './Projetos.css';

const Projetos = () => {
    return (
        <section id="portfolio" className="portfolio">
            <h2 className="titulo-secao">Portfólio e Projetos</h2>
            <p>Veja alguns dos meus projetos:</p>
            <div className="projetos-lista">
                <div className="projeto-card">
                    <h3>Projeto para Cliente</h3>
                    <p>Sistema de gestão de academias desenvolvido com Node.js e React.</p>
                </div>
                <div className="projeto-card">
                    <h3>Projeto Acadêmico</h3>
                    <p>Portal de notícias para estudos com Java e MySQL.</p>
                </div>
            </div>
        </section>
    );
};

export default Projetos;
